import '../SASS/main.scss';
import topBar from './topBar/topBar';
import slider from './slider/slider';
import calendar from './calendar/calendar';

class App extends Component {
  render() {
    return (
      <div className="App">
        <topBar></topBar>

        <h4 className="name">Mon</h4>
        <h4 className="name">Tue</h4>
        <h4 className="name">Wed</h4>
        <h4 className="name">Thu</h4>
        <h4 className="name">Fri</h4>
        <h4 className="name">Sat</h4>
        <h4 className="name">Sun</h4>
      </div>
    );
  }
}

export default App;
